// nightland/src/components/PrincessScreen.js
import React from 'react';
import princessImage from '../assets/images/sadprincess.png';
import * as text from '../assets/copy/textcontent.js';

const PrincessScreen = ({ onNext }) => (
    <div id="princess-screen">
        <img src={princessImage} alt="Princess Screen" />
        <button id="princess-button" onClick={onNext}>
            {text.princessScreenButtonText || 'Next'} {/* Fallback if not defined */}
        </button>
        <div id="dialog" className="princess-dialog"></div>
    </div>
);

export default PrincessScreen;
